// ==UserScript==
// @name         崩铁大地图 本地标记
// @namespace    http://tampermonkey.net/
// @version      3.1
// @description  让崩铁地图和原神地图一样可以标记
// @author       QL
// @match        https://webstatic.mihoyo.com/sr/app/interactive-map/index.html*
// @icon         data:image/jpeg;base64,
// @license      MIT
// @require      https://code.jquery.com/jquery-3.5.1.min.js
// @grant        GM_getValue
// @grant        GM_setValue
// @grant        GM_addStyle
// @grant        GM_deleteValue
// @grant        GM_xmlhttpRequest
// @grant        GM_setClipboard
// @grant        GM_notification
// @run-at       document-end
// @downloadURL https://update.greasyfork.org/scripts/471232/%E5%B4%A9%E9%93%81%E5%A4%A7%E5%9C%B0%E5%9B%BE%20%E6%9C%AC%E5%9C%B0%E6%A0%87%E8%AE%B0.user.js
// @updateURL https://update.greasyfork.org/scripts/471232/%E5%B4%A9%E9%93%81%E5%A4%A7%E5%9C%B0%E5%9B%BE%20%E6%9C%AC%E5%9C%B0%E6%A0%87%E8%AE%B0.meta.js
// ==/UserScript==

//https://webstatic.mihoyo.com/ys/app/interactive-map/index.html
(function () {
	"use strict";
	const DEBUG = false;

	//切换 地图/层级 会触发接口  https://api-static.mihoyo.com/common/srmap/sr_map/v1/map/info
	//当接口访问时,重新初始化
	let hookXhrOpen = XMLHttpRequest.prototype.open;
	XMLHttpRequest.prototype.open = function (m, uri, b) {
		hookXhrOpen.apply(this, [m, uri, b]);
		//log(uri);
		if (uri.indexOf("https://api-static.mihoyo.com/common/srmap/sr_map/v1/map/info") != -1) {
			init();
		}
	};

	//获取缓存的标记数据
	//const MARK = "mark_data";
	const MARK = "mark_data2";
	//物品id的class
	const GOODS = "goods_id";

	var mark_data = GM_getValue(MARK, {});

	//当前点击的下标
	var btn_index = undefined;

	//在缓存数据中查找是否未标记
	//true-未标记
	function unmark_check(index) {
		var res = !(mark_data[map_name()] && mark_data[map_name()].indexOf(index) >= 0);
		//log(`unmark_check[${index}]=>${res}`);
		return res;
	}

	//生成按钮html  is_unmark 是否未标记
	function button_div(index, is_unmark) {
		return `<div class="map-xt-popup__switch ${is_unmark ? "map-xt-popup__switch--unmarked" : "map-xt-popup__switch--marked"}">${is_unmark ? "标记" : "取消标记"}</div>`;
	}

	//保存标记    is_unmark  true-保存标记选中
	function mark_save(index, is_unmark) {
		var _map_name = map_name();
        if(typeof(mark_data) != "object"){
            console.log("缓存数据有误,重置");
            mark_data = {};
        }
		//过滤掉当前点,默认去除标记
		mark_data[_map_name] = (mark_data[_map_name] || []).filter((tt) => tt && tt != index);
		if (is_unmark) {
			//未标记,选中,并保存到缓存
			mark_data[_map_name] = (mark_data[_map_name] || []).concat([index]);
		}
		log("缓存数据",mark_data,JSON.stringify(mark_data));
		GM_setValue(MARK, mark_data);
		$(".map-xt-popup__switch").html(button_div(index, !is_unmark));
	}

	//获取当前选中的地图名称
	function map_name() {
		var t = $(".map-switch__item--active .map-switch__item-name");
		if (!t || !t.length) return undefined;
		//log("map_name",t);
		return t[0].textContent;
	}

	//将物品标记灰色  is_mark  true-上灰色
	function change_grayscale(index, gray) {
		//toggleClass
		if (gray) {
			log("物品", btn_index, "添加灰色");
			$("." + GOODS + "--" + index).addClass("_grayscale");
		} else {
			log("物品", btn_index, "取消灰色");
			$("." + GOODS + "--" + index).removeClass("_grayscale");
		}
	}

	//样式
	GM_addStyle(".map-xt-popup__switch--marked {color: #d3bc8e;background-image: url(data:image/png;base64,);}");
	GM_addStyle(".map-xt-popup__switch {font-size: .14rem;font-weight: 500;line-height: .36rem;width: 1.75rem;text-align: center;border-radius: .03rem;background-position: 50%;margin: 10px 0;}");
	GM_addStyle(".map-xt-popup__switch--unmarked {color: #3b4354;background-image: url(data:image/png;base64,);}");
	GM_addStyle("._grayscale {-webkit-filter: grayscale(100%);}");
	GM_addStyle(".menu-item--clean:hover {color: #fff;}  .menu-item--clean {  min-width: 1.3rem;  padding: 0 .22rem;  height: .48rem;  color: rgba(255,255,255,.7);  text-decoration: none;  cursor: pointer;  white-space: nowrap;  display: -webkit-box;  display: -ms-flexbox;  display: flex;  -webkit-box-align: center;  -ms-flex-align: center;  align-items: center;  -webkit-box-pack: start;  -ms-flex-pack: start;  justify-content: flex-start;  -webkit-transition: color .1s;  -o-transition: color .1s;  transition: color .1s;}");

	//初始化
	function init() {
		console.log("地图标记 初始化...");
		//等待地图加载完成(使用地图名称作为加载完毕的检测标准)
		var map_loaded_interval = setInterval(() => {
			if (!!map_name()) {
				clearInterval(map_loaded_interval);
				//界面加载完后触发主函数
				main();
			}
		}, 1000);
	}

	//主要功能调用
	function main() {
		//添加清空当前地图数据按钮
		var clean_btn = $(`<div class="menu-item menu-item--clean">清除当前地图标记</div>`);
		clean_btn.click(() => {
			var name = map_name();
			console.log("清除地图[" + name + "]的标记数据");
			mark_data[name] = [];
			GM_setValue(MARK, mark_data);
		location.reload();
		});
		var clean_all_btn = $(`<div class="menu-item menu-item--clean">清除所有地图标记</div>`);
		clean_all_btn.click(() => {
			console.log("清除所有标记数据");
			mark_data = {};
			GM_setValue(MARK, mark_data);
		location.reload();
		});
		$(".menu").append(clean_btn);
		$(".menu").append(clean_all_btn);

		//监听 弹出的详情页,并注入 标记按钮
		let observer = new MutationObserver((mutations, observer) => {
			mutations.forEach((mutation) => {
				//只监听新增的显示弹窗
				if (!mutation.addedNodes.length) return;
				//跳过已注入
				if (mutation.target.innerHTML.indexOf("map-xt-popup__switch") != -1) return;

				//log(mutation.target.className,mutation)
				//生成标记按钮
				var btn = $(button_div(btn_index, unmark_check(btn_index)));
				$(btn).click((e) => {
					log("物品", btn_index, "被点击", e.target.innerText);
					var is_mark = e.target.innerText == "取消标记" ? true : false;
					mark_save(btn_index, !is_mark);
					change_grayscale(btn_index, !is_mark);
				});
				$(mutation.target).find(".leaflet-popup-content .map-popup__content").append(btn);
			});
		});

		//监听详情弹出界面
		observer.observe($(".leaflet-popup-pane").get(0), { childList: true, subtree: false });
		//获取地图名称和缓存数据
		console.log("当前地图:" + map_name(), "标记数据:" + JSON.stringify(mark_data));

		//初始化物品id到class中
		$(".mhy-game-gis-marker").each((i, val) => {
			var t = $(val);
			//经证实_leaflet_id|z-index|_leaflet_pos  刷新地图界面后会爆炸(错乱),弃用
			//btn_index = val._leaflet_id;
			//btn_index = val._leaflet_pos.y || t.css("z-index");

			btn_index = i;
			//log("添加物品class", t, GOODS + "--" + btn_index);
			t.addClass(GOODS + "--" + btn_index);
			t.attr(GOODS, btn_index);

			//物品点击 响应的是这个,不是父元素
			//leaflet-marker-icon mhy-game-gis-marker goods_id--201
			//  mhy-game-gis-icon mhy-game-gis-icon__is-pc
			//    mhy-game-gis-icon__img
			//将物品下标写到响应元素上,省得拿父元素
			t.find(".mhy-game-gis-icon .mhy-game-gis-icon__img").attr(GOODS, btn_index);

			t.click((tt) => {
				btn_index = $(tt.target).attr(GOODS);
				log("物品被点击", btn_index);
			});
		});

		//初始化历史缓存的灰色
		var his = (mark_data[map_name()] || []).filter((tt) => tt);
		his.forEach((t) => {
			change_grayscale(t, !unmark_check(t));
		});

		console.log("地图标记 初始化完毕!!!");
	}

	//左侧边栏 地图选择
	//map-switch map-switch--show
	//  map-switch__wrapper(--active)
	//    map-switch__item(--active)
	//      map-switch__item-name

	//单个物品点
	//leaflet-marker-icon mhy-game-gis-marker(--selected) mhy-game-gis-marker-cnt-1 leaflet-zoom-hide leaflet-interactive
	//  mhy-game-gis-icon mhy-game-gis-icon__is-pc
	//    mhy-game-gis-icon__img   物品图标
	//    marker-arrow   层标
	//    mhy-map-cluster-icon__count  不明

	//弹出的详情页面
	//leaflet-pane leaflet-popup-pane
	//  leaflet-popup  leaflet-zoom-animated
	//    leaflet-popup-content-wrapper
	//      leaflet-popup-content

	//调试输出
	function log() {
		if (!DEBUG) return;
		console.log.apply(console, arguments);
	}
})();
